import {StyleSheet} from 'react-native';

export default StyleSheet.create({
  container: {
    marginTop: 15,
    borderTopLeftRadius: 25,
    borderTopRightRadius: 25,
    minHeight: 880,
  },
  tabBarStyle: {
    borderTopLeftRadius: 25,
    borderTopRightRadius: 25,
  },
});
